import React, { Component } from 'react';
import axios from 'axios';



class MainPage extends Component {

    state = {
        data: []
    }

    componentDidMount () {

        axios.get('https://academicbusinessplanner.firebaseio.com/businessplans.json')
            .then(response => {
                const fetchedData = [];
                for (let key in response.data) {
                    fetchedData.push({...response.data[key], id: key });
                }

                this.setState({data: fetchedData})
                console.log(this.state.data)
            });
    }
    render() {
        // return ( <div>1</div>)

        const plans = this.state.data.map(plan => {
            const fetchedDatas = [];
            for (let key in plan.data.external) {
                fetchedDatas.push({...plan.data.external[key], id: key });
            }

            this.setState({data: fetchedDatas})
            console.log(plan.data.external)
            return ( <div>1</div> )
        })
        return (
            <div>{plans}</div>)

    }
}

export default MainPage
